import Nav from '../nav/nav';
class CheckoutPage extends Component {
    render() {
        return (
            <>
                <Nav />
                <br />
                <Timeline />
                <div className='container'>
                    <div className='row'>
                        <Cart />
                        <Checkout />
                    </div>
                </div>
                <br />
            </>
        );
    }
}

export default CheckoutPage;
